import React, { Component } from "react";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import { Animated } from "react-animated-css";
import Toolbar from "@material-ui/core/Toolbar";
import MrpList from "./mrpList";

const styles = {
  header: {
    color: "#E040FB",
    fontFamily: "Righteous",
    fontWeight: "bold",
    fontSize: "3rem",
    position: "relative",
    bottom: "70px"
  },
  grid: {
    display: "flex",
    flexDirection: "column",
    justifyItems: "center",
    position: "relative",
    bottom: "60px"
  },
  home: {
    color: "#d8dcf2",
    fontSize: "2rem",
    fontFamily: "Lobster, cursive",
    textDecoration: "underline",
    textDecorationColor: "#e040fb",
    float: "left"
  },
  body: {
    position: "relative",
    top: 70
  },
  all: {
    backgroundColor: "#212127d3",
    borderRadius: "20px",
    margin: 30
  },
  info: {
    color: "#d8dcf2",
    fontFamily: "Quicksand",
    fontWeight: "bold",
    fontSize: "30px",
    position: "relative",
    bottom: "70px"
  },
  picture: {
    maxWidth: "100%",
    maxHeight: "100vh",
    margin: "auto"
  },
  buttonContainer: {
    width: "95%",
    display: "block"
  },
  buttons: {
    float: "right"
  },
  button: {
    backgroundColor: "#e040fb",
    position: "relative",
    bottom: 40,
    width: 300,
    height: 50
  },
  date: {
    color: "#E040FB"
  }
};

class MrpResult extends Component {
  render() {
    const { classes } = this.props;

    return (
      <React.Fragment>
        <Toolbar className={classes.buttonContainer}>
          <Animated
            animationIn="fadeInRight"
            animationOut="fadeOut"
            isVisible={true}
          >
            <Button id="home" className={classes.home} href="/">
              Universa Localis
            </Button>
          </Animated>

          <Button id="buttons" className={classes.buttons} href="contact">
            Contact
          </Button>
          <Button id="buttons" className={classes.buttons} href="about">
            About
          </Button>
          <Button id="buttons" className={classes.buttons} href="/">
            Home
          </Button>
        </Toolbar>

        <div className={classes.all}>
          <div className={classes.body}>
            <h1 className={classes.header}>
              {this.props.receivedInfo.name[0]}
            </h1>
            <h3 className={classes.info}>
              Date: {this.props.receivedInfo.earth_date[0]}
            </h3>

            {this.props.receivedInfo.photos.map(i => (
              <MrpList camera={i.camera.full_name} img_src={i.img_src} />
            ))}

            <Button
              className={classes.button}
              variant="contained"
              color="primary"
              style={{ marginBottom: 70 }}
              href="/mrp"
            >
              Go Back
            </Button>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default withStyles(styles)(MrpResult);
